// SPDX-License-Identifier: MIT
pragma solidity ^0.8.30;

contract  Original{

    uint[] aarrray;

    function Calculo(uint x, uint y) public  pure returns (uint){
        return x * y;
    }

    function P_array(uint indice) public view returns (uint){
        return aarrray[indice]; 
    }
}

contract Papagaio_Cria{

    address[] array;

    function Criar_Contratos() public {

        Original instacia  =  new Original();

        array.push(address(instacia));

    }

    function Pegar_address(uint indice) public view returns(address){

    }

}


contract Sum{

    uint[] array;

    uint public x;

    constructor (uint _x){
        x = _x;
    }

    function soma( uint _y) public returns (uint){

        array.push(x + _y);

        return x + _y;
    }

    function PegarArray(uint _indice) public view returns (uint){
        return array[_indice];
    }
}

contract Fabrica{

    address[] public enderecos;

    function CriaNovosoma(uint _x) public {

        // Criei uma nova instancia do contrato Sum, ultilizando new Sum()
        Sum NovoSoma = new Sum(_x);

        // A parti dessa instancia, eu peguei o endereço e gravei na array 
        enderecos.push(address(NovoSoma));

    }
}

